  }
  return (
    <Router>
      <div >

        <Suspense fallback={<div>Loading...</div>}>
          <NavBar />
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/about" element={<AboutPage />} />
            <Route path="/contact" component={<ContactPage />} />
          </Routes>
        </Suspense>
      </div>
    </Router>

  );
}

export default App;
